import React from "react";
import { Link } from "react-router-dom";

const SearchBarResult = ({ id, name, symbol }) => {
  return (
    <>
      <Link key={id} to="#" className="block w-full hover:bg-gray-300">
        <img
          src={`https://s2.coinmarketcap.com/static/img/coins/128x128/${id}.png`}
          alt={crypto}
          className="absolute mt-3 rounded-full w-7 h-7 right-6"
        />
        <h3 className="font-medium text-gray-700 dark:text-gray-100">{name}</h3>
        <p className="mt-2 text-sm text-gray-500 dark:text-gray-400">
          {symbol}
        </p>
      </Link>
    </>
  );
};

export default SearchBarResult;
